import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import LandingPage from "./Pages/LandingPage.js";
import AboutPage from "./Pages/AboutPage.js";
import PrivacyPage from "./Pages/PrivacyPage.js";
import ContactUsPage from "./Pages/ContactUsPage.js";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
      User: []
    };
  }
  render() {
    return (
      <Router>
        <div className="backGroundColor">
          <Route path="/" exact render={() => <LandingPage isLoggedIn={this.state.isLoggedIn} />} />
          <Route path="/about" exact render={() => <AboutPage isLoggedIn={this.state.isLoggedIn} />} />
          <Route path="/contactus" exact render={() => <ContactUsPage isLoggedIn={this.state.isLoggedIn} />} />
          <Route path="/privacy" exact render={() => <PrivacyPage isLoggedIn={this.state.isLoggedIn} />} />
        </div>
      </Router>
    );
  }
}

export default App;
// npm install --save react-router-dom
// npm install --save bootstrap
// npm install --save reactstrap react react-dom
// npm install --save react-router-dom
